      flexGrow: 1,
      clear:"both",
    },
  }));


export default function ContactPage(){
    const classes = useStyles();

return (
      <Grid container className={classes.root}>
        <Grid item xs={12}>

                            <ContactCard name="Ammar Daham" />
                            <ContactCard name="Omar " />
                            </Grid>
        </Grid>
    );

}
